using FluentAssertions;
using Playground.LeetCode;
using System.Diagnostics;
using Xunit;

namespace Playground.UnitTests.LeetCode
{
    public class LongestStringWithoutRepeatingCharsUnitTests
    {
        [Fact]
        public void WhenStringIsNull_ReturnsZero()
        {
            var service = new LongestStringWithoutRepeatingChars();

            var result = service.LengthOfLongestSubstring(null);

            result.Should().Be(0);
        }

        [Fact]
        public void WhenStringIsEmpty_ReturnsZero()
        {
            var service = new LongestStringWithoutRepeatingChars();

            var result = service.LengthOfLongestSubstring("");

            result.Should().Be(0);
        }

        [Fact]
        public void WhenStringHasOneCharacter_ReturnsOne()
        {
            var service = new LongestStringWithoutRepeatingChars();

            var result = service.LengthOfLongestSubstring("a");

            result.Should().Be(1);
        }

        [Fact]
        public void WhenStringHasOnlyUniqueCharacters_ReturnsLength()
        {
            var service = new LongestStringWithoutRepeatingChars();

            var result = service.LengthOfLongestSubstring("qwerty");

            result.Should().Be(6);
        }

        [Theory]
        [InlineData("zzzabc12311abc", 7)]
        [InlineData("bbbbbb", 1)]
        [InlineData("abcabcbb", 3)]
        [InlineData("pwwkew", 3)]
        [InlineData("00000100abc000", 4)]
        [InlineData("dvedf", 4)]
        public void WhenStringIsPopulated_ReturnsCorrectValue(string value, int expected)
        {
            var service = new LongestStringWithoutRepeatingChars();

            var result = service.LengthOfLongestSubstring(value);

            result.Should().Be(expected);
        }

